const contentSwitchers=document.querySelectorAll(".premium-content-switcher");contentSwitchers.forEach(e=>{const t=e.querySelector(".premium-content-switcher-two-content");t.children[1].style.display="none",t.children[0].style.display="block",t.style.display="block",e.querySelector(".premium-content-switcher-toggle-switch-label input").addEventListener("change",e=>{e.target.checked?(t.children[1].style.display="block",t.children[0].style.display="none"):(t.children[0].style.display="block",t.children[1].style.display="none")})});